import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Products</h1>
      <div>
        <h3>Laptop</h3>
        <h4>£299.99</h4>
        <img src="https://brain-images-ssl.cdn.dixons.com/4/2/10199624/u_10199624.jpg"/>
        <button>Add to Cart</button>
      </div>

      <div>
        <h3>Pc Mouse</h3>
        <h4>£30.99</h4>
        <img src="https://media.4rgos.it/s/Argos/9213513_R_SET?w=270&h=270&qlt=75&fmt=webp"/>
        <button>Add to Cart</button>
      </div>

    </div>
  );
}

export default App;
